     content: "  ,  ,  ,  ,  ,    FlipHorizontally Interactive menu command to this function:   Description&nbsp;{% raw %} FlipHorizontally();{% endraw %}Flips the image horizontally.  FlipHorizontallyND Description&nbsp;{% raw %} FlipHorizontallyND(\n   int  NDTLoop,\n   int  NDMPLoop,\n   int  NDZLoop\n);{% endraw %}Flips the ND image horizontally.Parameters int  {% raw %}NDTLoop{% endraw %}  0apply to the current loop only 1apply to the whole Time dimension int  {% raw %}NDMPLoop{% endraw %} Apply to Multi Point dimension. 0apply to the current loop only 1apply to the whole Multi Point dimension int  {% raw %}NDZLoop{% endraw %} Apply to Z dimension 0apply to the current loop only 1apply to the whole Z Series dimension  FlipVertically Interactive menu command to this function:   Description&nbsp;{% raw %} FlipVertically();{% endraw %}Flips the image vertically.  FlipVerticallyND Description&nbsp;{% raw %} FlipVerticallyND(\n   int  NDTLoop,\n   int  NDMPLoop,\n   int  NDZLoop\n);{% endraw %}Flips the ND image vertically.Parameters int  {% raw %}NDTLoop{% endraw %}  0apply to the current loop only 1apply to the whole Time dimension int  {% raw %}NDMPLoop{% endraw %} Apply to Multi Point dimension. 0apply to the current loop only 1apply to the whole Multi Point dimension int  {% raw %}NDZLoop{% endraw %} Apply to Z dimension 0apply to the current loop only 1apply to the whole Z Series dimension  _FlipHorizontally This function runs the    menu command.Description&nbsp;{% raw %} _FlipHorizontally();{% endraw %}Flips the current image horizontally.  _FlipVertically This function runs the    menu command.Description&nbsp;{% raw %} _FlipVertically();{% endraw %}Flips the current image vertically. ",
