     content: "  ,  ,  ,    ImageAttachmentRemove This function runs the    menu command.Description&nbsp;{% raw %} ImageAttachmentRemove();{% endraw %}This function removes the attached file.  _ImageAttachmentAdd This function runs the    menu command.Description&nbsp;{% raw %} _ImageAttachmentAdd();{% endraw %}This function appends an arbitrary file to the currently opened image document. Select Attachment window appears, where you can specify the appended file.  _ImageAttachmentOpen This function runs the    menu command.Description&nbsp;{% raw %} _ImageAttachmentOpen();{% endraw %}This function opens the file attached to the currently opened document.  _ImageAttachmentSaveAs This function runs the    menu command.Description&nbsp;{% raw %} _ImageAttachmentSaveAs();{% endraw %}This function saves the attached file to a custom location. ",
