     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    ManualMeasLoadSettings Description&nbsp;{% raw %} ManualMeasLoadSettings(\n   char *MeasurementFileName\n);{% endraw %}Loads the previously saved measured data and configuration of their display from an external file.Parameters char *{% raw %}MeasurementFileName{% endraw %} Defines complete path to the file you want to load / save.  ManualMeasSaveSettings Description&nbsp;{% raw %} ManualMeasSaveSettings(\n   char *MeasurementFileName\n);{% endraw %}Saves the measured data and configuration of their display to an external file.Parameters char *{% raw %}MeasurementFileName{% endraw %} Defines complete path to the file you want to load / save.  MeasObjectExclusion Description&nbsp;{% raw %} MeasObjectExclusion(\n   int  MeasFrameInclude,\n   int  MeasROIInclude,\n   int  MeasImageInclude\n);{% endraw %}Sets the rules for excluding objects in the Automated measurement. The rules are used based on the visibility of measurement frame and ROI. If both frame and ROI are turned off, the rule for the whole image applies.Parameters int  {% raw %}MeasFrameInclude{% endraw %} Measurement frame rule. 0Include objects touching frame borders 1Exclude objects touching frame borders 2Include objects touching top or right border int  {% raw %}MeasROIInclude{% endraw %} ROI rule 0Include objects touching ROI borders 1Exclude objects touching ROI borders 2Intersection - Use only part of the object inside ROI int  {% raw %}MeasImageInclude{% endraw %} Image borders rule. Used only when both frame and ROI are turned off. 0Include objects touching image borders 1Exclude objects touching image borders  MeasurementLoadSettings Description&nbsp;{% raw %} MeasurementLoadSettings(\n   char *MeasurementFileName\n);{% endraw %}This function loads the current measurement settings from a specified file.Parameters char *{% raw %}MeasurementFileName{% endraw %} Defines complete path to the file you want to load / save.See Also&nbsp; ,  ,    MeasurementSaveSettings Description&nbsp;{% raw %} MeasurementSaveSettings(\n   char *MeasurementFileName\n);{% endraw %}This function saves the current measurement settings into a file.Parameters char *{% raw %}MeasurementFileName{% endraw %} Defines complete path to the file you want to load / save.See Also&nbsp; ,  ,    _FeatureGraph This function runs the    menu command.Description&nbsp;{% raw %} _FeatureGraph();{% endraw %}This function displays the Time Series Graph window.  _ManualMeasLoadSettings Description&nbsp;{% raw %} _ManualMeasLoadSettings();{% endraw %}Loads the previously saved measured data and configuration of their display from an external file.See Also&nbsp;   _ManualMeasSaveSettings Description&nbsp;{% raw %} _ManualMeasSaveSettings();{% endraw %}Saves the measured data and configuration of their display to an external file.See Also&nbsp;   _MeasurementLoadSettings Description&nbsp;{% raw %} _MeasurementLoadSettings();{% endraw %}This function loads the current automated measurement settings from a file. It displays the Load Configuration and Data window.See Also&nbsp; ,  ,    _MeasurementSaveSettings Description&nbsp;{% raw %} _MeasurementSaveSettings();{% endraw %}This function saves the current automated measurement settings to a file. It displays the Save Configuration and Data... window.See Also&nbsp; ,  ,    ShowIntensitySurfacePlot This function runs the    menu command.Description&nbsp;{% raw %} ShowIntensitySurfacePlot();{% endraw %}This function generates an image surface view based on the pixel intensity values. ",
