     content: "  ,  ,  ,  ,  ,  ,    Measure3DVolume Description&nbsp;{% raw %} Measure3DVolume();{% endraw %}This function displays the Volume Measurement control window. When an ND2 (incl. Z dimension) image is opened the volume measurement is performed.  MeasureField Description&nbsp;{% raw %} MeasureField();{% endraw %}This function performs measurement on the selected field. A set of size, shape and density measurements defined by the Field Features command (Measure menu) is performed on a field.See Also&nbsp; ,  ,  ,  ,  ,    MeasureFieldND Interactive menu command to this function:   Description&nbsp;{% raw %} MeasureFieldND(\n   int  NDTLoop,\n   int  NDMPLoop,\n   int  NDZLoop\n);{% endraw %}This function performs measurement on the selected field and dimension.Parameters int  {% raw %}NDTLoop{% endraw %}  0apply to the current loop only 1apply to the whole Time dimension int  {% raw %}NDMPLoop{% endraw %} Apply to Multi Point dimension. 0apply to the current loop only 1apply to the whole Multi Point dimension int  {% raw %}NDZLoop{% endraw %} Apply to Z dimension 0apply to the current loop only 1apply to the whole Z Series dimension A set of size, shape and density measurements defined by the Field Features command (Measure menu) is performed on a field.See Also&nbsp; ,  ,  ,  ,  ,    ResetFieldFeatures Description&nbsp;{% raw %} ResetFieldFeatures();{% endraw %}This function clears features for field measurement. This function is typically called, when you invoke the Field Features command (Measure menu). An interactive equivalent is the   function.See Also&nbsp; ,  ,    SelectFieldFeature Description&nbsp;{% raw %} SelectFieldFeature(\n   char *FeatName\n);{% endraw %}This function defines a feature to be included in field measurement.Parameters char *{% raw %}FeatName{% endraw %} Name of the measurement feature.See Also&nbsp; ,    _FieldMeasSetup This function runs the    menu command.Description&nbsp;{% raw %} _FieldMeasSetup();{% endraw %}  _MeasureFieldND This function runs the    menu command.Description&nbsp;{% raw %} _MeasureFieldND();{% endraw %}This function equals the   function except when performed on ND2 document you will be prompt to select whether to process the current image, selected dimension, or the whole ND document. ",
