     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    ManualMeasure Description&nbsp;{% raw %} ManualMeasure(\n   int  ManMeasType,\n   int  StartX,\n   int  StartY,\n   int  EndX,\n   int  EndY\n);{% endraw %}Performs manual measurement using the parameters set.Parameters int  {% raw %}ManMeasType{% endraw %} For which type of manual measurement the feature is designed. Counts1 Length2 Area4 Angle8 Radius16 SemiAxes32 Taxonomy64 Length3D128 int  {% raw %}StartX{% endraw %} X coordinate of the start point. int  {% raw %}StartY{% endraw %} Y coordinate of the start point. int  {% raw %}EndX{% endraw %} X coordinate of the end point. int  {% raw %}EndY{% endraw %} Y coordinate of the end point.  ManualMeasureClear Description&nbsp;{% raw %} ManualMeasureClear();{% endraw %}Clears any manual measurements in the current image.  ManualMeasureReset Description&nbsp;{% raw %} ManualMeasureReset(\n   int  All\n);{% endraw %}Resets the measurement table in Manual Measurement.Parameters int  {% raw %}All{% endraw %} reset all  Measure3DAngle This function runs the    menu command.Description&nbsp;{% raw %} Measure3DAngle();{% endraw %}This function measures an angle inside a 3D image. After executing this function, use the primary mouse button and define three points to measure the angle. The current ND2 document must contain a Z dimension. Slices View, Volume View or Surface View (EDF) should be displayed in order for the measurement to work.  Measure3DLength This function runs the    menu command.Description&nbsp;{% raw %} Measure3DLength();{% endraw %}This function selects the 3D length measurement tool. The Slices View or the Surface View (EDF) should be displayed in order for the 3D length measurement to work. The current ND2 document must contain Z slices.  Measure3DPolyline This function runs the    menu command.Description&nbsp;{% raw %} Measure3DPolyline();{% endraw %}This function measures the polyline xyz length inside a 3D image. After executing this function, use the primary mouse button to define the polyline. The current ND2 document must contain a Z dimension. Slices View, Volume View or Surface View (EDF) should be displayed in order for the measurement to work.  MeasureAngle This function runs the    menu command.Description&nbsp;{% raw %} MeasureAngle();{% endraw %}This function can be used for interactive measurement of angles. The function displays the Angle dialog box.  MeasureArea This function runs the    menu command.Description&nbsp;{% raw %} MeasureArea();{% endraw %}This function starts area interactive measurement. Area measurement dialog is displayed.See Also&nbsp; ,  ,  ,  ,  ,    MeasureCounts This function runs the    menu command.Description&nbsp;{% raw %} MeasureCounts();{% endraw %}This function starts counts interactive measurement. Counts measurement dialog is displayed.See Also&nbsp; ,  ,  ,  ,  ,    MeasureLength This function runs the    menu command.Description&nbsp;{% raw %} MeasureLength();{% endraw %}This function starts length interactive measurement. Length measurement dialog is displayed.See Also&nbsp; ,  ,  ,  ,    MeasureNumbers This function runs the    menu command.Description&nbsp;{% raw %} MeasureNumbers();{% endraw %}This function starts numbers interactive measurement. Numbers measurement dialog is displayed.See Also&nbsp; ,  ,  ,  ,  ,    MeasureRadius This function runs the    menu command.Description&nbsp;{% raw %} MeasureRadius();{% endraw %}This function starts radius interactive measurement. Radius measurement dialog is displayed.See Also&nbsp; ,  ,  ,  ,  ,    MeasureSemiaxes This function runs the    menu command.Description&nbsp;{% raw %} MeasureSemiaxes();{% endraw %}This function starts semiaxes interactive measurement. Semiaxes measurement dialog is displayed.See Also&nbsp; ,  ,  ,  ,  ,    _MeasureLengthAdv This function runs the    menu command.Description&nbsp;{% raw %} _MeasureLengthAdv();{% endraw %}Opens a control panel for manual distance measurement. See   . ",
