     content: "  ,  ,  ,  ,    DataDelimiter Description&nbsp;{% raw %} DataDelimiter(\n   int  delimiter\n);{% endraw %}This function enables you to define delimiter between data to output file. This function is typically called, when you invoke the Data Delimiter command (Measure menu). An interactive equivalent is   function.Parameters int  {% raw %}delimiter{% endraw %} Type of data delimiter. 9tab 32space 59semicolon If you export data to MS Excel, it is recommended to use the Tab data delimiter which is the default for MS Excel.See Also&nbsp;   SetCopyMeasFromLive Description&nbsp;{% raw %} SetCopyMeasFromLive(\n   int  Enabled\n);{% endraw %}Set it the manual measurement objects on live image should be copied to captured image.1 = copy manual measurement objects from live image to captured.Parameters int  {% raw %}Enabled{% endraw %}  0Disabled. 1Enabled.  _DataDelimiter Description&nbsp;{% raw %} _DataDelimiter();{% endraw %}The function displays the Data Delimiter dialog box.  _MeasurementOptions This function runs the    menu command.Description&nbsp;{% raw %} _MeasurementOptions();{% endraw %}The function configures annotation properties for the interactive measurement.  _TaxonomyOptions This function runs the    menu command.Description&nbsp;{% raw %} _TaxonomyOptions();{% endraw %} ",
