     content: "  ,    Heart_Analyze Description&nbsp;{% raw %}BYTE Heart_Analyze(\n   int *Heart_X,\n   int *Heart_StartY,\n   int *Heart_EndY\n);{% endraw %}This is a special function used by the application which estimates the heart rate frequency.Parameters int *{% raw %}Heart_X{% endraw %}  int *{% raw %}Heart_StartY{% endraw %}  int *{% raw %}Heart_EndY{% endraw %} Return Values BYTE  This function is used by the application which estimates the heart rate frequency by analyzing specially transformed series of heart pictures. It analyzes the binary layer.  PSNR Description&nbsp;{% raw %} PSNR(\n   int  DocIdx1,\n   int  DocIdx2\n);{% endraw %}This function counts peak signal to noise ratio.Parameters int  {% raw %}DocIdx1{% endraw %} Index of the first opened document. int  {% raw %}DocIdx2{% endraw %} Index of the second opened document. ",
