     content: "  ,  ,  ,    ND_CreateKymographBySelectedLine Description&nbsp;{% raw %} ND_CreateKymographBySelectedLine();{% endraw %}Creates a kymograph from the selected line in the current image.See Also   ND_KymographLineSettings Interactive menu command to this function:   Description&nbsp;{% raw %} ND_KymographLineSettings(\n   int  LineThickness,\n   int  LineIntensityValue\n);{% endraw %}This function sets the kymograph line thickness and the intensity calculation method.Parameters int  {% raw %}LineThickness{% endraw %} Line neighbourhood area thickness [px]. Final line intensity is calculated from the average intensity of this area. int  {% raw %}LineIntensityValue{% endraw %} Intensity calculation method of the kymograph line with width greater than 1 px. 0Mean 1Max 2MinSee Also&nbsp; ,    _ND_CreateKymographByLine This function runs the    menu command.Description&nbsp;{% raw %} _ND_CreateKymographByLine();{% endraw %}This function executes the line drawing mode and creates a kymograph from this line after being confirmed by the secondary mouse click.See Also&nbsp; ,    _ND_KymographLineSettings This function runs the    menu command.Description&nbsp;{% raw %} _ND_KymographLineSettings();{% endraw %}Opens the Kymograph Parameters dialog window.See Also&nbsp; ,   ",
