     content: "  ,  ,  ,  ,  ,    ND_CreateMaxIntProjectionImageT This function runs the    menu command.Description&nbsp;{% raw %} ND_CreateMaxIntProjectionImageT();{% endraw %}Creates maximal intensity projection from the T dimension of the current image.  ND_CreateMaxIntProjectionImageZ This function runs the    menu command.Description&nbsp;{% raw %} ND_CreateMaxIntProjectionImageZ();{% endraw %}Creates maximal intensity projection from the Z dimension of the current image.  ND_CreateMinIntProjectionImageT This function runs the    menu command.Description&nbsp;{% raw %} ND_CreateMinIntProjectionImageT();{% endraw %}Creates minimal intensity projection from the T dimension of the current image.  ND_CreateMinIntProjectionImageZ This function runs the    menu command.Description&nbsp;{% raw %} ND_CreateMinIntProjectionImageZ();{% endraw %}Creates minimal intensity projection from the Z dimension of the current image.  ND_ShowMaxIntProjectionImage This function runs the    menu command.Description&nbsp;{% raw %} ND_ShowMaxIntProjectionImage(\n   int  OpenToNewWindow\n);{% endraw %}This function displays the maximum intensity projection of the current ND2 document. Z or time dimension must be present in the ND2 file.Parameters int  {% raw %}OpenToNewWindow{% endraw %} Open image in a new window. 0behaves according to what is set in Edit &gt; Options &gt; General &gt; Open new ND views to new window 1behaves contrary to what is set in Edit &gt; Options &gt; General &gt; Open new ND views to new window  ND_ShowMinIntProjectionImage This function runs the    menu command.Description&nbsp;{% raw %} ND_ShowMinIntProjectionImage(\n   int  OpenToNewWindow\n);{% endraw %}This function displays the minimum intensity projection of the current ND2 document. Z or time dimension must be present in the ND2 file.Parameters int  {% raw %}OpenToNewWindow{% endraw %} Open image in a new window. 0behaves according to what is set in Edit &gt; Options &gt; General &gt; Open new ND views to new window 1behaves contrary to what is set in Edit &gt; Options &gt; General &gt; Open new ND views to new window ",
