     content: "  ,    Org_OpenImage Description&nbsp;{% raw %} Org_OpenImage(\n   int  RecordIndex\n);{% endraw %}Function opens the image of the specified record. The function acts above all records in the active datasource.Parameters int  {% raw %}RecordIndex{% endraw %} Index of the record.See Also&nbsp; ,  ,  ,    Org_OpenImageEx Description&nbsp;{% raw %} Org_OpenImageEx(\n   int  DataSource,\n   int  RecordIndex,\n   char *FieldName,\n   int  Refresh\n);{% endraw %}Function opens the image of the specified record. The function acts above all records in the specified datasource. Function tries to find a field with the specified name as unique identifier. If fails, then tries to find a field with the specified name.Parameters int  {% raw %}DataSource{% endraw %} Index of the datasource from which the data are read. 0The datasource of the left pane. 1The datasource of the right pane. int  {% raw %}RecordIndex{% endraw %} Index of the record. char *{% raw %}FieldName{% endraw %} Name or unique name of the field. int  {% raw %}Refresh{% endraw %} Flag to force open next location change. 0Do not change open next location. 1Change open next location.See Also&nbsp; ,  ,  ,   ",
