     content: "  ,    Wait Description&nbsp;{% raw %} Wait(\n   double  WaitTime\n);{% endraw %}This function forces NIS-Elements to wait WaitTime seconds.Parameters double  {% raw %}WaitTime{% endraw %} Specifies time in seconds NIS-Elements waits while not responding to any commands. If WaitTime is 0, Continue button appears and NIS-Elements is waiting until you press it.  WaitText Description&nbsp;{% raw %} WaitText(\n   double  WaitTextTime,\n    Text\n);{% endraw %}This function forces NIS-Elements to display the Text on the screen and wait WaitTime seconds.Parameters double  {% raw %}WaitTextTime{% endraw %} Specifies time in seconds NIS-Elements waits while not responding to any commands. If WaitTime is 0, Continue button appears and NIS-Elements is waiting until you press it.  {% raw %}Text{% endraw %} Message that is displayed while NIS-Elements waits for processing further commands. If this function is running in macro, Ctrl+Pause keys invoke immediate message “Interrupt Macro Execution” and you are able to stop execution. ",
