     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    AutoCapture2 Description&nbsp;{% raw %} AutoCapture2(\n   int  iActiveGrabber\n);{% endraw %}This function performs the Capture command and saves the captured image to the hard disk according to the settings specified by the   function. The Auto Capture folder will appear.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  CapturePreview2 Description&nbsp;{% raw %} CapturePreview2(\n   int  iActiveGrabber\n);{% endraw %}Runs the   function using the specified camera.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  FineGrab2 Description&nbsp;{% raw %} FineGrab2(\n   int  iActiveGrabber\n);{% endraw %}This function runs the   function with the specified camera.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  Freeze2 Description&nbsp;{% raw %} Freeze2(\n   int  iActiveGrabber\n);{% endraw %}Runs the   function using the specified camera.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  GetActiveGrabber Description&nbsp;{% raw %} GetActiveGrabber();{% endraw %}This function returns index of the active camera (0 or 1).  GetActiveGrabberCount Description&nbsp;{% raw %} GetActiveGrabberCount();{% endraw %}This function returns the number of cameras connected to the system at the moment (1 or 2).See Also&nbsp;   Live2 Description&nbsp;{% raw %} Live2(\n   int  iActiveGrabber\n);{% endraw %}Runs the   function using the specified camera.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  LiveSync2 Description&nbsp;{% raw %} LiveSync2(\n   int  iActiveGrabber\n);{% endraw %}Runs the   function using the specified camera.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  SetActiveGrabber Description&nbsp;{% raw %} SetActiveGrabber(\n   int  iActiveGrabber\n);{% endraw %}If there are two cameras in the system, this function activates the camera specified by the parameter.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  ZStack_Live2 Description&nbsp;{% raw %} ZStack_Live2(\n   int  iActiveGrabber\n);{% endraw %}Runs the   function using the specified camera.Parameters int  {% raw %}iActiveGrabber{% endraw %} Index number of a camera 0The first (primary) camera 1The second (secondary) camera  _DefineCameraLightPath This function runs the    menu command.Description&nbsp;{% raw %} _DefineCameraLightPath();{% endraw %}Set the light path properties in the dialog window that appears after you run this command.  _InputDriver2 Description&nbsp;{% raw %} _InputDriver2(\n   int  iGrabberToSelect\n);{% endraw %}On multiple-camera systems, it displays the Driver Selection dialog window.Parameters int  {% raw %}iGrabberToSelect{% endraw %} Index number of the position which will be active for selection via keyboard. 0Focus on the primary camera 1Focus on the secondary camera ",
