     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    LiveWindowSetup This function runs the    menu command.Description&nbsp;{% raw %} LiveWindowSetup(\n   int  pos\n);{% endraw %}This function defines the position of live window.Parameters int  {% raw %}pos{% endraw %} Live window position. LW_LEFTHALFLeft half of the picture window. LW_RIGHTHALFRight half of the picture window. LW_TOPHALFTop half of the picture window. LW_BOTTOMHALFBottom half of the picture window. LW_UPPERLEFTUpper left corner of the picture window. LW_UPPERRIGHTUpper right corner of the picture window. LW_BOTTOMLEFTBottom left corner of the picture window. LW_BOTTOMRIGHTBottom right corner of the picture window.See Also&nbsp; ,    SplitHorizontallyLiveBottom This function runs the    menu command.Description&nbsp;{% raw %} SplitHorizontallyLiveBottom();{% endraw %}This function displays the live image in the bottom pane and the original image in the top pane.Return Values  This function returns true.See Also&nbsp;   SplitHorizontallyLiveTop This function runs the    menu command.Description&nbsp;{% raw %} SplitHorizontallyLiveTop();{% endraw %}This function displays the live image in the top pane and the original image in the bottom pane.Return Values  This function returns true.See Also&nbsp;   SplitVerticallyLiveLeft This function runs the    menu command.Description&nbsp;{% raw %} SplitVerticallyLiveLeft();{% endraw %}Splits the screen horizontally and displays the live image in the left pane and original image in the bottom pane.See Also&nbsp; ,  ,    SplitVerticallyLiveRight This function runs the    menu command.Description&nbsp;{% raw %} SplitVerticallyLiveRight();{% endraw %}Splits the screen horizontally and displays live image in the right pane and original image in the bottom pane.See Also&nbsp; ,  ,    ViewAlternateLive This function runs the    menu command.Description&nbsp;{% raw %} ViewAlternateLive();{% endraw %}This function alternates the original image and the live image in a user-defined rectangle. The rectangle can be defined by drawing on the screen using the mouse.  ViewBinaryMaskedLive This function runs the    menu command.Description&nbsp;{% raw %} ViewBinaryMaskedLive();{% endraw %}Displays the original image at pixels where the binary image is equal to zero and the live image at pixels where the binary image is equal to one.See Also&nbsp;   ViewDifferenceLive This function runs the    menu command.Description&nbsp;{% raw %} ViewDifferenceLive();{% endraw %}Displays the difference between the live and the original images.  ViewInterlacedLive This function runs the    menu command.Description&nbsp;{% raw %} ViewInterlacedLive();{% endraw %}Displays the live image in the odd lines and the original image in the even lines.  ViewLiveRectangle This function runs the    menu command.Description&nbsp;{% raw %} ViewLiveRectangle();{% endraw %}Displays alternately the original image and the live image in a user-defined rectangle. The rectangle can be defined by drawing on the screen using the mouse.  ViewPseudoRedGreenLive This function runs the    menu command.Description&nbsp;{% raw %} ViewPseudoRedGreenLive();{% endraw %}Displays the live image in the red component and the original image in the green component.  ViewTransparentLive This function runs the    menu command.Description&nbsp;{% raw %} ViewTransparentLive();{% endraw %}Displays the average of original and live images in a user-defined rectangle. The rectangle can be defined by drawing with a mouse on the screen.  _DefineCameraCorrection Description&nbsp;{% raw %} _DefineCameraCorrection();{% endraw %}The Define point defects mask wizard starts.See Also&nbsp; ,   ",
