     content: "  ,    GetOCRImageText Description&nbsp;{% raw %} GetOCRImageText(\n   char *OCRText,\n   int  BufferSize\n);{% endraw %}Fills the text buffer with the recognized text from the current image.Parameters char *{% raw %}OCRText{% endraw %} First buffer. int  {% raw %}BufferSize{% endraw %} Size of the memory allocated for the previous parameter (number of characters).  GetOCRInfo Description&nbsp;{% raw %} GetOCRInfo(\n   char *OCRText,\n   int  BufferSize\n);{% endraw %}Fills the text buffer with information about the OCR subsystem in MS Windows (installed languages, maximal image dimensions, etc.).Parameters char *{% raw %}OCRText{% endraw %} First buffer. int  {% raw %}BufferSize{% endraw %} Size of the memory allocated for the previous parameter (number of characters). ",
