     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    PixelClassifierAddClasses Description&nbsp;{% raw %} PixelClassifierAddClasses(\n   int  ClassifierClassCount\n);{% endraw %}Adds a specified number of phases into the Pixel Classifier.Parameters int  {% raw %}ClassifierClassCount{% endraw %} Number of phases.  PixelClassifierDefineBayes Description&nbsp;{% raw %} PixelClassifierDefineBayes(\n   int  PickerSize,\n   int  ClassifierClassID\n);{% endraw %}Selects the Bayes pixel classification method and a phase.Parameters int  {% raw %}PickerSize{% endraw %} Size of the picker. 1 single point 2 3 point single 3 6 point circle int  {% raw %}ClassifierClassID{% endraw %} Phase selection. 0First table row. 1Second table row, etc.  PixelClassifierDefineManual Description&nbsp;{% raw %} PixelClassifierDefineManual(\n   int  ClassifierThresholdPos,\n   int  ClassifierClassID\n);{% endraw %}Selects the Manual pixel classification method and defines the threshold of the selected phase.Parameters int  {% raw %}ClassifierThresholdPos{% endraw %} Higher threshold value (0–255) of the selected phase. int  {% raw %}ClassifierClassID{% endraw %} Phase selection. 0First table row. 1Second table row, etc.  PixelClassifierDefineNeural Description&nbsp;{% raw %} PixelClassifierDefineNeural(\n   int  PickerSize,\n   int  ClassifierClassID\n);{% endraw %}Selects the Neural pixel classification method on a selected phase and defines the picker size.Parameters int  {% raw %}PickerSize{% endraw %} Size of the picker. 1 single point 2 3 point single 3 6 point circle int  {% raw %}ClassifierClassID{% endraw %} Phase selection. 0First table row. 1Second table row, etc.  PixelClassifierDefinitionClose Description&nbsp;{% raw %} PixelClassifierDefinitionClose();{% endraw %}Controls the   Define button in the Pixel Classifier which switches between the standard and the training mode.  PixelClassifierDefinitionReset Description&nbsp;{% raw %} PixelClassifierDefinitionReset();{% endraw %}Deletes all data created in the training mode.  PixelClassifierDeselectInputChannel Description&nbsp;{% raw %} PixelClassifierDeselectInputChannel(\n   int  ClassifierChannel\n);{% endraw %}Deselects the defined channel found in the Channels combo box of the Pixel Classifier.Parameters int  {% raw %}ClassifierChannel{% endraw %} Channel ID. 0First channel 1Second channel, etc.  PixelClassifierExportToExcel Description&nbsp;{% raw %} PixelClassifierExportToExcel();{% endraw %}Exports the measured data into MS Excel.  PixelClassifierGetClassCount Description&nbsp;{% raw %} PixelClassifierGetClassCount(\n   int  ClassifierClassCount\n);{% endraw %}Returns the number of defined phases.Parameters int  {% raw %}ClassifierClassCount{% endraw %} Number of phases.  PixelClassifierGetMeasuredArea Description&nbsp;{% raw %} PixelClassifierGetMeasuredArea(\n   int  ClassifierClassID,\n   int  ClassifierArea,\n   int  ClassifierAreaFract\n);{% endraw %}Returns the Area and Area Fraction values measured in the Pixel Classifier.Parameters int  {% raw %}ClassifierClassID{% endraw %} Phase selection. 0First table row. 1Second table row, etc. int  {% raw %}ClassifierArea{% endraw %} Area [px2] values. int  {% raw %}ClassifierAreaFract{% endraw %} Area Fraction [%] values.  PixelClassifierInROI Description&nbsp;{% raw %} PixelClassifierInROI(\n   int  Enabled\n);{% endraw %}Sets the pixel classification to be performed only inside the ROI(s).Parameters int  {% raw %}Enabled{% endraw %}  0Disabled. 1Enabled.  PixelClassifierLoadSettings Description&nbsp;{% raw %} PixelClassifierLoadSettings(\n   char *ClassifierFileName\n);{% endraw %}This function loads current pixel classifier settings from a specified file.Parameters char *{% raw %}ClassifierFileName{% endraw %} Defines complete path to the file you want to save/load.See Also&nbsp; ,  ,    PixelClassifierND Description&nbsp;{% raw %} PixelClassifierND(\n   int  NDTLoop,\n   int  NDMPLoop,\n   int  NDZLoop\n);{% endraw %}Runs pixel classifier and performs classification according to the last used settings.Parameters int  {% raw %}NDTLoop{% endraw %}  0apply to the current loop only 1apply to the whole Time dimension int  {% raw %}NDMPLoop{% endraw %} Apply to Multi Point dimension. 0apply to the current loop only 1apply to the whole Multi Point dimension int  {% raw %}NDZLoop{% endraw %} Apply to Z dimension 0apply to the current loop only 1apply to the whole Z Series dimension  PixelClassifierRefresh Description&nbsp;{% raw %} PixelClassifierRefresh();{% endraw %}Updates the classification data of the Pixel Classifier dialog using the current image.  PixelClassifierRemoveAllData Description&nbsp;{% raw %} PixelClassifierRemoveAllData();{% endraw %}Clears all classification stored data.  PixelClassifierRemoveClasses Description&nbsp;{% raw %} PixelClassifierRemoveClasses(\n   int  ClassifierClassCount\n);{% endraw %}Deletes phases in the Pixel Classifier table from the bottom to the top.Parameters int  {% raw %}ClassifierClassCount{% endraw %} Number of phases.  PixelClassifierRemoveData Description&nbsp;{% raw %} PixelClassifierRemoveData();{% endraw %}Removes the currently selected classification stored data.  PixelClassifierSaveSettings Description&nbsp;{% raw %} PixelClassifierSaveSettings(\n   char *ClassifierFileName\n);{% endraw %}This function saves current pixel classifier settings into a file.Parameters char *{% raw %}ClassifierFileName{% endraw %} Defines complete path to the file you want to save/load.See Also&nbsp; ,  ,    PixelClassifierSelectInputChannel Description&nbsp;{% raw %} PixelClassifierSelectInputChannel(\n   int  ClassifierChannel\n);{% endraw %}Selects the defined channel found in the Channels combo box of the Pixel Classifier.Parameters int  {% raw %}ClassifierChannel{% endraw %} Channel ID. 0First channel 1Second channel, etc.  PixelClassifierSelectInputData Description&nbsp;{% raw %} PixelClassifierSelectInputData(\n   int  ClassifierData\n);{% endraw %}Defines the feature on which the Pixel Classifier will classify.Parameters int  {% raw %}ClassifierData{% endraw %} Classification feature. 0Intensity 1Channels 2Hue, Saturation, Intensity 3Ratio  PixelClassifierSetClassCount Description&nbsp;{% raw %} PixelClassifierSetClassCount(\n   int  ClassifierClassCount\n);{% endraw %}Sets the number of phases to be present in the Pixel Classifier.Parameters int  {% raw %}ClassifierClassCount{% endraw %} Number of phases.  PixelClassifierSetSmooth Description&nbsp;{% raw %} PixelClassifierSetSmooth(\n   int  Enabled,\n   int  ClassifierSmoothLevel\n);{% endraw %}Controls the   Smooth button of the Pixel Classifier which applies the smooth operation onto the classified objects.Parameters int  {% raw %}Enabled{% endraw %}  0Disabled. 1Enabled. int  {% raw %}ClassifierSmoothLevel{% endraw %} Smooth strength.  PixelClassifierShowAreaFract Description&nbsp;{% raw %} PixelClassifierShowAreaFract(\n   int  Enabled\n);{% endraw %}Displays classification stored data as an area fraction in [%].Parameters int  {% raw %}Enabled{% endraw %}  0Disabled. 1Enabled.  PixelClassifierStore Description&nbsp;{% raw %} PixelClassifierStore();{% endraw %}Saves the current classification data into the stored data.  _PixelClassifierLoadSettings Description&nbsp;{% raw %} _PixelClassifierLoadSettings();{% endraw %}This function loads the current pixel classifier settings from a file. The function displays the Load Pixel Classifier Configuration window.See Also&nbsp; ,  ,    _PixelClassifierND Description&nbsp;{% raw %} _PixelClassifierND();{% endraw %}Performs the pixel classification according to the last used settings of the Pixel Classifier either on all frames or on a selected dimension.  _PixelClassifierSaveSettings Description&nbsp;{% raw %} _PixelClassifierSaveSettings();{% endraw %}This function saves the current pixel classifier settings to a file. The function displays the Save Pixel Classifier Configuration... window.See Also&nbsp; ,  ,   ",
