     content: "  ,  ,  ,  ,  ,    GPA_OpenResults Description&nbsp;{% raw %} GPA_OpenResults(\n   double  RunKey\n);{% endraw %}Opens the specified GPA results inside the Analysis Results panel.Parameters double  {% raw %}RunKey{% endraw %} Key to the results.  _GPA_Remeasure Description&nbsp;{% raw %} _GPA_Remeasure(\n   char *DefinitionName\n);{% endraw %}Repeats the GPA measurement.Parameters char *{% raw %}DefinitionName{% endraw %} Name of the definition.  _GPA_Run Description&nbsp;{% raw %} _GPA_Run(\n   char *DefinitionName\n);{% endraw %}Switches to the GPA Run layout, selects the DefinitionName preset in the GPA run guiElement and the operator can start measuring (Operator mode GPA).Parameters char *{% raw %}DefinitionName{% endraw %} Name of the definition.  _GPA_RunAsAdministrator Description&nbsp;{% raw %} _GPA_RunAsAdministrator(\n   char *DefinitionName\n);{% endraw %}Starts the GPA measurement for a specified definition in the admin mode, where the administrator can define the thresholding options, such as fill holes, clean, size restriction, etc., which is not allowed in the operator mode.Parameters char *{% raw %}DefinitionName{% endraw %} Name of the definition.  _GPA_Definition Description&nbsp;{% raw %} _GPA_Definition(\n   char *DefinitionName\n);{% endraw %}Switches to the GPA Definition layout, selects the DefinitionName preset and enables the user to edit the definition (Administrator mode GPA).Parameters char *{% raw %}DefinitionName{% endraw %} Name of the definition.  _GPA_DefinitionsUpdate Description&nbsp;{% raw %} _GPA_DefinitionsUpdate();{% endraw %}This internal function updates the explorer GPA definition, e.g. when a new GPA definition is added. ",
