     content: "  ,  ,  ,  ,  ,  ,  ,    ObjectClassifierExportToClipboard Description&nbsp;{% raw %} ObjectClassifierExportToClipboard();{% endraw %}This function exports the measured data to the system clipboard.  ObjectClassifierExportToExcel Description&nbsp;{% raw %} ObjectClassifierExportToExcel();{% endraw %}This function exports measured data to MS Excel.  ObjectClassifierExportToFile Description&nbsp;{% raw %} ObjectClassifierExportToFile(\n   char *ObjectClassifierPath\n);{% endraw %}This function exports defined object classifier to an external file.Parameters char *{% raw %}ObjectClassifierPath{% endraw %} File name and path to the file into which the classifier is exported.  ObjectClassifierLoadSettings Description&nbsp;{% raw %} ObjectClassifierLoadSettings(\n   char *ObjectClassifierFileName\n);{% endraw %}This function loads the current object classifier settings from a specified file.Parameters char *{% raw %}ObjectClassifierFileName{% endraw %} Defines complete path to the file you want to load / save.  ObjectClassifierSaveSettings Description&nbsp;{% raw %} ObjectClassifierSaveSettings(\n   char *ObjectClassifierFileName\n);{% endraw %}This function saves the current object classifier settings into a file.Parameters char *{% raw %}ObjectClassifierFileName{% endraw %} Defines complete path to the file you want to load / save.  _ObjectClassifierExportToFile Description&nbsp;{% raw %} _ObjectClassifierExportToFile();{% endraw %}This function saves the measured data to a file. It displays the Export to file dialog window.  _ObjectClassifierLoadSettings Description&nbsp;{% raw %} _ObjectClassifierLoadSettings();{% endraw %}This function loads the current object classifier settings from a file. The function displays the Load Object Classifier Configuration dialog window.  _ObjectClassifierSaveSettings Description&nbsp;{% raw %} _ObjectClassifierSaveSettings();{% endraw %}This function saves the current object classifier settings to a file. The function displays the Save Object Classifier Configuration dialog window. ",
