     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    Profile_Data_ExportClipboard Description&nbsp;{% raw %} Profile_Data_ExportClipboard();{% endraw %}This function exports the intensity profile data to the system clipboard.See Also&nbsp; ,    Profile_Data_ExportExcel Description&nbsp;{% raw %} Profile_Data_ExportExcel();{% endraw %}This function exports intensity profile data to MS Excel, if installed.See Also&nbsp; ,    Profile_Data_Recalculate Description&nbsp;{% raw %} Profile_Data_Recalculate();{% endraw %}This function recalculates intensity profile data and redraws the graph. Use this function to redraw the graph after changing position of the profile line (e.g. after using the   function).See Also&nbsp;   Profile_DefineCross Description&nbsp;{% raw %} Profile_DefineCross(\n   int  X1,\n   int  Y1,\n   int  Radius,\n   double  RotationAngle\n);{% endraw %}This function draws a cross-shaped intensity profile line into the image. The center of the cross is placed on the X and Y coordinate. Radius parameter specifies the radius of the circle touching the tips of the cross.Parameters int  {% raw %}X1{% endraw %} X coordinate in pixels. int  {% raw %}Y1{% endraw %} Y coordinate in pixels. int  {% raw %}Radius{% endraw %} Radius length in pixels. double  {% raw %}RotationAngle{% endraw %} Angle of rotation of the cross. To recalculate data of a new line position call the   function.See Also&nbsp; ,    Profile_DefineLine Description&nbsp;{% raw %} Profile_DefineLine(\n   bool  SecondProfileLine,\n   int  X1,\n   int  Y1,\n   int  X2,\n   int  Y2\n);{% endraw %}This function defines profile line position. Each line starts on the X1 and Y1 coordinate and ends on the X2 and Y2 coordinate.Parameters bool  {% raw %}SecondProfileLine{% endraw %} Choose 1 to enable second profile line, 0 to disable second profile line. int  {% raw %}X1{% endraw %} X coordinate in pixels. int  {% raw %}Y1{% endraw %} Y coordinate in pixels. int  {% raw %}X2{% endraw %} X coordinate in pixels. int  {% raw %}Y2{% endraw %} Y coordinate in pixels. To recalculate data of a new line position call the   function.See Also&nbsp;   Profile_DefinePolyLine Description&nbsp;{% raw %} Profile_DefinePolyLine(\n   bool  SecondProfileLine,\n   int  LpXs,\n   int  LpYs,\n   int  Number\n);{% endraw %}This function draws a polyline from input coordinates.Parameters bool  {% raw %}SecondProfileLine{% endraw %} Choose 1 to enable second profile line, 0 to disable second profile line. int  {% raw %}LpXs{% endraw %} Pointer to X coordinates that defines the polyline. int  {% raw %}LpYs{% endraw %} Pointer to Y coordinates that defines the polyline. int  {% raw %}Number{% endraw %} Number of input coordinates. For recalculate data of new line position call the   function.See Also&nbsp;   Profile_ExportAll Description&nbsp;{% raw %} Profile_ExportAll();{% endraw %}This function opens MS Excel (if installed) and inserts the intensity profile data and graph into a new table.  Profile_Graph_ExportClipboard Description&nbsp;{% raw %} Profile_Graph_ExportClipboard();{% endraw %}This function exports intensity profile graph to the system clipboard.See Also&nbsp; ,    Profile_Graph_Redraw Description&nbsp;{% raw %} Profile_Graph_Redraw();{% endraw %}This function redraws the profile intensity graph.See Also&nbsp;   Profile_Options Description&nbsp;{% raw %} Profile_Options(\n   int  BgColor,\n   int  AxesColor,\n   int  LineThick,\n   int  SecondThick,\n   int  SecondStyle,\n   int  ColorHighlight\n);{% endraw %}This function sets intensity profile options.Parameters int  {% raw %}BgColor{% endraw %} Graph background color. int  {% raw %}AxesColor{% endraw %} Graph axes color. int  {% raw %}LineThick{% endraw %} Graph line thickness. int  {% raw %}SecondThick{% endraw %} Graph second line thickness. int  {% raw %}SecondStyle{% endraw %} Graph second line style. 0Solid 1Dot 2Dash 3DashDot int  {% raw %}ColorHighlight{% endraw %} Graph second line highlighting. 0Enable 1Disable  Profile_SetAutoScale Description&nbsp;{% raw %} Profile_SetAutoScale(\n   int  AutoScale\n);{% endraw %}This function switches the intensity profile graph scale mode.Parameters int  {% raw %}AutoScale{% endraw %} Autoscale. 0Disable autoscale. 1Enable autoscale.  Profile_SetNumProfiles Description&nbsp;{% raw %} Profile_SetNumProfiles(\n   int  Number\n);{% endraw %}This function sets the intensity profile lines count.Parameters int  {% raw %}Number{% endraw %} Define lines count. 1Set intensity profile lines count to 1. 2Set intensity profile lines count to 2.  Profile_SetView Description&nbsp;{% raw %} Profile_SetView(\n   int  ProfileView\n);{% endraw %}This function switches between the intensity profile tabs.Parameters int  {% raw %}ProfileView{% endraw %}  0Activate default [Graph] tab. 1Activate [Data] tab.  Profile_ShowGrid Description&nbsp;{% raw %} Profile_ShowGrid(\n   int  ShowGrid\n);{% endraw %}This function displays/hides grid on intensity profile graph.Parameters int  {% raw %}ShowGrid{% endraw %} Displays or hides grid. 0Hides grid. 1Displays grid.  _Profile_Data_ExportFile Description&nbsp;{% raw %} _Profile_Data_ExportFile();{% endraw %}This function displays a dialog window for exporting the current intensity profile to a text file. Put in the filename and confirm the export with Save.See Also&nbsp;   _Profile_Graph_ExportFile Description&nbsp;{% raw %} _Profile_Graph_ExportFile();{% endraw %}This function displays a dialog window for exporting the current intensity profile image to a *.BMP file. Put in the filename and confirm the export with Save.See Also&nbsp;   _Profile_Options Description&nbsp;{% raw %} _Profile_Options();{% endraw %}This function displays the Intensity Profile Options dialog window. ",
