     content: " (requires:  ) ,  ,  ,  ,    _CaloTest Description&nbsp;{% raw %} _CaloTest();{% endraw %}Opens the Layer Thickness Measurement panel with the Calo Test tab selected.  _CircularLayers Description&nbsp;{% raw %} _CircularLayers();{% endraw %}Opens the Layer Thickness Measurement panel with the Circular tab selected.  _GeneralLayers Description&nbsp;{% raw %} _GeneralLayers();{% endraw %}Opens the Layer Thickness Measurement panel with the General tab selected.  _LayersSettings This function runs the    menu command.Description&nbsp;{% raw %} _LayersSettings();{% endraw %}Opens the Layer Thickness Measurement used for industrial layer measurement.  _LinearLayers Description&nbsp;{% raw %} _LinearLayers();{% endraw %}Opens the Layer Thickness Measurement panel with the Linear tab selected. ",
