     content: " (requires:  ) ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    HelpOnCI Description&nbsp;{% raw %} HelpOnCI();{% endraw %}Opens the electronic help on the Metalo - Cast Iron Analysis page.  ME_CIAbortSequence Description&nbsp;{% raw %} ME_CIAbortSequence();{% endraw %}Aborts the Cast Iron measurement on a sequence.  ME_CICancelMeasure Description&nbsp;{% raw %} ME_CICancelMeasure();{% endraw %}Cancels the Cast Iron measurement.  ME_CIDefaultLayout Description&nbsp;{% raw %} ME_CIDefaultLayout();{% endraw %}Opens the Cast Iron default layout.  ME_CIDetectAndMeasure Description&nbsp;{% raw %} ME_CIDetectAndMeasure(\n   char *ciparam1,\n   char *ciparam2\n);{% endraw %}Executes the Cast Iron Detect and Measure with the specified parameters.Parameters char *{% raw %}ciparam1{% endraw %} Cast Iron parameter 1. char *{% raw %}ciparam2{% endraw %} Cast Iron parameter 2.  ME_CIFinishMeasure Description&nbsp;{% raw %} ME_CIFinishMeasure();{% endraw %}Cancels the Cast Iron measurement.  ME_CILearn Description&nbsp;{% raw %} ME_CILearn();{% endraw %}Executes the Cast Iron learning.  ME_CIMaskProperties Description&nbsp;{% raw %} ME_CIMaskProperties();{% endraw %}Opens the Cast Iron mask properties.  ME_CINextTemplate Description&nbsp;{% raw %} ME_CINextTemplate();{% endraw %}Moves to the next Cast Iron template.  ME_CIOptions Description&nbsp;{% raw %} ME_CIOptions();{% endraw %}Opens the Cast Iron Options dialog window setting up some general options, labels and export properties.  ME_CIPrevTemplate Description&nbsp;{% raw %} ME_CIPrevTemplate();{% endraw %}Moves to the previous Cast Iron template.  ME_CIShowMask Description&nbsp;{% raw %} ME_CIShowMask();{% endraw %}Shows the Cast Iron mask.  ME_CISetupTools Description&nbsp;{% raw %} ME_CISetupTools();{% endraw %}Opens the Toolbar Setup window where you can add shortcuts to any commands used in the Cast Iron application. The command is then added to the main left toolbar.  ME_CIStartMeasure Description&nbsp;{% raw %} ME_CIStartMeasure();{% endraw %}Start the Cast Iron measurement.  ME_CIStartMeasureSequence Description&nbsp;{% raw %} ME_CIStartMeasureSequence();{% endraw %}Opens the Measure Cast Iron on Sequence dialog window.  ME_CIUndoNext Description&nbsp;{% raw %} ME_CIUndoNext();{% endraw %}Calls the Cast Iron Undo Next command.  ME_CIUndoPrev Description&nbsp;{% raw %} ME_CIUndoPrev();{% endraw %}Calls the Cast Iron Undo Previous command.  ME_CIUndoSwap Description&nbsp;{% raw %} ME_CIUndoSwap();{% endraw %}Calls the Undo Swap in the Edit menu.  ME_FinishCastIron Description&nbsp;{% raw %} ME_FinishCastIron();{% endraw %}This function switches application mode from the Grain Size measurement to NIS-Elements.  ME_GSNextTemplate Description&nbsp;{% raw %} ME_GSNextTemplate();{% endraw %}Moves to the next Grain Size template.  ME_GSPrevTemplate Description&nbsp;{% raw %} ME_GSPrevTemplate();{% endraw %}Moves to the previous Grain Size template.  ME_StartCastIron This function runs the    menu command.Description&nbsp;{% raw %} ME_StartCastIron();{% endraw %}This function switches application to the Metallography mode - Cast Iron Analysis and loads settings for this module.  ME_SwitchCastIron Description&nbsp;{% raw %} ME_SwitchCastIron();{% endraw %}This function switches application to the Cast Iron Analysis from the other metallography modules (e.g. Grain size measurement). ",
