     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    HD_CloseReport Description&nbsp;{% raw %} HD_CloseReport();{% endraw %}Closes the Report (Hardness Application).  HD_DisplayCrossHair Description&nbsp;{% raw %} HD_DisplayCrossHair(\n   int  Show\n);{% endraw %}Displays the Indenter Cross Hair (Hardness Application).Parameters int  {% raw %}Show{% endraw %} Index of the element which should be shown or hidden. 0Hide the pane. 1Show the pane.  HD_DisplayData Description&nbsp;{% raw %} HD_DisplayData(\n   int  Show\n);{% endraw %}Displays the Hardness data.Parameters int  {% raw %}Show{% endraw %} Index of the element which should be shown or hidden. 0Hide the pane. 1Show the pane.  HD_DisplayGraph Description&nbsp;{% raw %} HD_DisplayGraph(\n   int  Show\n);{% endraw %}Displays the Hardness graph.Parameters int  {% raw %}Show{% endraw %} Index of the element which should be shown or hidden. 0Hide the pane. 1Show the pane.  HD_EmptyData Description&nbsp;{% raw %} HD_EmptyData();{% endraw %}Resets all data and allows the setup of the new measurement features (Hardness Application).  HD_IsDataWindow Description&nbsp;{% raw %} HD_IsDataWindow();{% endraw %}Returns the data window state (Hardness Application).  HD_IsGraphWindow Description&nbsp;{% raw %} HD_IsGraphWindow();{% endraw %}Returns the graph window state (Hardness Application).  _HD_DefineOrigin Description&nbsp;{% raw %} _HD_DefineOrigin();{% endraw %}Switches to a mode where the user can define a horizontal profile origin line (Hardness Application).  _HD_MarkIndentorPos Description&nbsp;{% raw %} _HD_MarkIndentorPos();{% endraw %}Switches to a mode where the user can draw the first and second diagonal line of the shape (Hardness Application).  _HD_MeasMethod Description&nbsp;{% raw %} _HD_MeasMethod(\n   int  Method\n);{% endraw %}Opens the Hardness dialog window for the method selection (Hardness Application).Method parameter set to 3 opens the Hardness window for the method selection.Parameters int  {% raw %}Method{% endraw %} Selects a method.  _HD_Measure Description&nbsp;{% raw %} _HD_Measure();{% endraw %}Measures hardness (Hardness Application).  _HD_NewSample Description&nbsp;{% raw %} _HD_NewSample();{% endraw %}Opens the New sample definition dialog window (Hardness Application).  _HD_NewTest Description&nbsp;{% raw %} _HD_NewTest();{% endraw %}Opens the New Test Definition dialog window (Hardness Application).  _HD_Setup Description&nbsp;{% raw %} _HD_Setup();{% endraw %}Opens the Hardness Setup dialog window (Hardness Application).  _HD_ShowReport Description&nbsp;{% raw %} _HD_ShowReport();{% endraw %}Shows the hardness report (Hardness Application).  _HD_SurfaceTreatment Description&nbsp;{% raw %} _HD_SurfaceTreatment();{% endraw %}Opens the Surface Treatment dialog window (Hardness Application). ",
