     content: "  ,  ,  ,  ,  ,    BinaryEdit This function runs the    menu command.Description&nbsp;{% raw %} BinaryEdit();{% endraw %}  GraticuleClear This function runs the    menu command.Description&nbsp;{% raw %} GraticuleClear();{% endraw %}  GraticuleEdit This function runs the    menu command.Description&nbsp;{% raw %} GraticuleEdit();{% endraw %}  GraticuleEditEx Description&nbsp;{% raw %} GraticuleEditEx(\n   int  EditStyle,\n   int  EditFG,\n   int  EditBrush,\n   int  EditNumber\n);{% endraw %}Draws the graticule mask.Parameters int  {% raw %}EditStyle{% endraw %} Drawing mode. 0Draw by hand. 1Draw continuous line. 2Draw polygon. 3Draw filled polygon. 4Draw subsequent lines. 5Fill an enclosed shape 6Draw circle. 7Draw filled circle. 8Draw rectangle. 9Draw filled rectangle. 10Draw ellipse. 11Draw filled ellipse. 12Rose mode. 13Marking mode. Note, that in this mode the thickness of the brush (==EditBrush parameter) defines marker type. 14Connecting mode. 15Cross lines. 16Accepted area mode. 21Bezier closed curve. 22Bezier filled closed curve. 23Threshold 24Auto Detect Hollow 25Auto Detect Fill 26Select Objects 27Circle 3 Pts. Hollow 28Circle 3 Pts. Fill int  {% raw %}EditFG{% endraw %} foreground/background. 0Background. 1Foreground. int  {% raw %}EditBrush{% endraw %} Thickness of a brush/pen. Note, that in marking mode (EditStyle==13) the thickness of the brush defines marker type. 01 pixel. In marking mode (EditStyle==13), it is marker #1. 11 pixel. In marking mode (EditStyle==13), it is marker #1. 22 pixels. In marking mode (EditStyle==13), it is marker #2. 33 pixels. In marking mode (EditStyle==13), it is marker #3. 44 pixels. In marking mode (EditStyle==13), it is marker #4. 55 pixels. In marking mode (EditStyle==13), it is marker #5. 66 pixels. In marking mode (EditStyle==13), it is marker #6. 77 pixels. In marking mode (EditStyle==13), it is marker #7. 88 pixels. In marking mode (EditStyle==13), it is marker #8. 99 pixels. In marking mode (EditStyle==13), it is marker #9. int  {% raw %}EditNumber{% endraw %} Number of drawing.See Also&nbsp;   ImageEdit This function runs the    menu command.Description&nbsp;{% raw %} ImageEdit();{% endraw %}This function displays the Tool window and allows binary image editing.See Also&nbsp; ,    ImageEditEx Description&nbsp;{% raw %} ImageEditEx(\n   int  EditStyle,\n   int  EditFG,\n   int  EditBrush,\n   int  EditNumber\n);{% endraw %}This function edits the binary image in a predefined mode.Parameters int  {% raw %}EditStyle{% endraw %} Drawing mode. 0Draw by hand. 1Draw continuous line. 2Draw polygon. 3Draw filled polygon. 4Draw subsequent lines. 5Fill an enclosed shape 6Draw circle. 7Draw filled circle. 8Draw rectangle. 9Draw filled rectangle. 10Draw ellipse. 11Draw filled ellipse. 12Rose mode. 13Marking mode. Note, that in this mode the thickness of the brush (==EditBrush parameter) defines marker type. 14Connecting mode. 15Cross lines. 16Accepted area mode. 21Bezier closed curve. 22Bezier filled closed curve. 23Threshold 24Auto Detect Hollow 25Auto Detect Fill 26Select Objects 27Circle 3 Pts. Hollow 28Circle 3 Pts. Fill int  {% raw %}EditFG{% endraw %} foreground/background. 0Background. 1Foreground. int  {% raw %}EditBrush{% endraw %} Thickness of a brush/pen. Note, that in marking mode (EditStyle==13) the thickness of the brush defines marker type. 01 pixel. In marking mode (EditStyle==13), it is marker #1. 11 pixel. In marking mode (EditStyle==13), it is marker #1. 22 pixels. In marking mode (EditStyle==13), it is marker #2. 33 pixels. In marking mode (EditStyle==13), it is marker #3. 44 pixels. In marking mode (EditStyle==13), it is marker #4. 55 pixels. In marking mode (EditStyle==13), it is marker #5. 66 pixels. In marking mode (EditStyle==13), it is marker #6. 77 pixels. In marking mode (EditStyle==13), it is marker #7. 88 pixels. In marking mode (EditStyle==13), it is marker #8. 99 pixels. In marking mode (EditStyle==13), it is marker #9. int  {% raw %}EditNumber{% endraw %} Number of drawing.See Also&nbsp; ,  ,   ",
