     content: "  ,  ,  ,  ,  ,  ,  ,  ,    BinaryFromReference This function runs the    menu command.Description&nbsp;{% raw %} BinaryFromReference();{% endraw %}See Also&nbsp; ,  ,  ,    BinaryFromReferenceND This function runs the    menu command.Description&nbsp;{% raw %} BinaryFromReferenceND();{% endraw %}  BinaryMore Description&nbsp;{% raw %} BinaryMore(\n   int  BinOper,\n   int  DestPic,\n   int  SourPic\n);{% endraw %}This function enables managing binary images.Parameters int  {% raw %}BinOper{% endraw %} Type of memory operation. 0Copy source to destination images. 1Exchange source and destination images. int  {% raw %}DestPic{% endraw %} Destination binary image. 0Current binary image. 1Undo for binary image. 2Reference binary image. 3Measurement ROI. 4Ref1 binary image. 5Ref2 binary image. 6Ref3 binary image. int  {% raw %}SourPic{% endraw %} Source binary image. 0Current binary image. 1Undo for binary image. 2Reference binary image. 3Measurement ROI. 4Ref1 binary image. 5Ref2 binary image. 6Ref3 binary image.See Also&nbsp; ,  ,  ,  ,  ,  ,    BinaryOperations Interactive menu command to this function:   Description&nbsp;{% raw %} BinaryOperations(\n   int  LogOp\n);{% endraw %}This function enables logical transformations of binary images.Parameters int  {% raw %}LogOp{% endraw %} Specifies type of logical operation. 0(A) AND (B) 1(A) OR (B) 2(A) / (B) 3(B) / (A) 4(A) XOR (B) 5(A) EQU (B)See Also&nbsp;   BinaryOperationsND Description&nbsp;{% raw %} BinaryOperationsND(\n   int  LogOp,\n   int  NDTLoop,\n   int  NDMPLoop,\n   int  NDZLoop\n);{% endraw %}This function enables logical transformations of binary images.Parameters int  {% raw %}LogOp{% endraw %} Specifies type of logical operation. 0(A) AND (B) 1(A) OR (B) 2(A) / (B) 3(B) / (A) 4(A) XOR (B) 5(A) EQU (B) int  {% raw %}NDTLoop{% endraw %}  0apply to the current loop only 1apply to the whole Time dimension int  {% raw %}NDMPLoop{% endraw %} Apply to Multi Point dimension. 0apply to the current loop only 1apply to the whole Multi Point dimension int  {% raw %}NDZLoop{% endraw %} Apply to Z dimension 0apply to the current loop only 1apply to the whole Z Series dimensionSee Also&nbsp;   BinarySwapReference This function runs the    menu command.Description&nbsp;{% raw %} BinarySwapReference();{% endraw %}This function swaps reference and current binary images. This function works if the current image has only one binary layer.See Also&nbsp; ,  ,  ,    BinaryToReference This function runs the    menu command.Description&nbsp;{% raw %} BinaryToReference();{% endraw %}This function copies the current binary image to the Reference binary image.See Also&nbsp; ,  ,  ,  ,    _BinaryMore Description&nbsp;{% raw %} _BinaryMore();{% endraw %}This function has been deprecated.See Also&nbsp;   _BinaryOperations This function runs the    menu command.Description&nbsp;{% raw %} _BinaryOperations();{% endraw %}This function displays the Binary Operations dialog box.See Also&nbsp;  ",
