     content: "  ,    DB_AppendField Description&nbsp;{% raw %} DB_AppendField(\n   int64  DB_TableHandle,\n   char *DB_FieldName,\n   int  DB_FieldType,\n   char *DB_DefValue,\n   int  DB_DefTitle,\n   int  DB_FieldMapping,\n   char *EnumValues\n);{% endraw %}This function performs the second step (  function must be called before it) of the creating new table procedure. Use this function to append fields in new table - each call adds a new field.Parameters int64  {% raw %}DB_TableHandle{% endraw %} Handle returned by   function. char *{% raw %}DB_FieldName{% endraw %} Name of the new field. int  {% raw %}DB_FieldType{% endraw %} Can be one of following values: 0Unknown. 1Integer. 2Double. 3String. 4LongString. 5Boolean. 6Enumeration. 7DateTime (double value of The Julian Day Number). 11ExternalLink. char *{% raw %}DB_DefValue{% endraw %} Default value (as string). int  {% raw %}DB_DefTitle{% endraw %} Nonzero if this field should be shown as title. int  {% raw %}DB_FieldMapping{% endraw %} Can be one of the following values: 0Default value. 1Filename. 3Path. 4Dimensions. 5Size. 6Filedate. 7Calibration. 8Image ID. 9Type. 10Group. 11Sample ID. 12Author. 13Description. 14Capturing. 15Sampling. 16Location. 17Date. 18Conclusion. 19Info1. 20Info2. 21Optics. char *{% raw %}EnumValues{% endraw %} If field type is enumeration then EnumValues must be string consists of enum. values separated by zeros and ended by double zero eg. “value1\\0value2\\0value3\\0\\0”.See Also&nbsp; ,    DB_SetField Description&nbsp;{% raw %} DB_SetField(\n   char *DB_FieldName,\n   char *DB_FieldValue\n);{% endraw %}This function sets the field value in the active record that has been previously selected by the   function.Parameters char *{% raw %}DB_FieldName{% endraw %} Name of the new field. char *{% raw %}DB_FieldValue{% endraw %} The new field value (as string).See Also&nbsp; ,  ,  ,   ",
