     content: "  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,  ,    Stg_HeatStageContinueCooling Description&nbsp;{% raw %} Stg_HeatStageContinueCooling();{% endraw %}When called, the heating/cooling device starts cooling.  Stg_HeatStageContinueHeating Description&nbsp;{% raw %} Stg_HeatStageContinueHeating();{% endraw %}When called, the heating stage starts heating.  Stg_HeatStageGetCurrentTemperature Description&nbsp;{% raw %} Stg_HeatStageGetCurrentTemperature();{% endraw %}This function returns the current temperature of the heating stage.  Stg_HeatStageGetStatus Description&nbsp;{% raw %}int Stg_HeatStageGetStatus();{% endraw %}This function returns information about the heating stage status.Return Values int Heating stage (temperature) status 0None - the status is not defined 1Cooling - the stage temperature is subsiding. 2Heating - the stage temperature is rising to the defined limit. 3Holding - the current temperature is being maintained on user request 4At Limit - the defined temperature has been reached and is maintained Different incubators/heating stages start “Holding” after the target temperature is reached and the function returns 3. Other devices reach the target temperature and let it uncontrolled afterwards - the function returns 4.  Stg_HeatStageHoldCurrentTemperature Description&nbsp;{% raw %} Stg_HeatStageHoldCurrentTemperature();{% endraw %}When called, the heating stage interrupts heating/cooling and keeps the current temperature.  Stg_HeatStageIsPresent Description&nbsp;{% raw %} Stg_HeatStageIsPresent();{% endraw %}Checks if the heating stage is connected.Return Values  This function returns TRUE (1) if the heating stage is connected, else FALSE (0).  Stg_HeatStageSetTemperature Description&nbsp;{% raw %} Stg_HeatStageSetTemperature(\n   double  Temperature\n);{% endraw %}This function sets the target temperature of a heating/cooling device in degrees Celsius.Parameters double  {% raw %}Temperature{% endraw %} The temperature in degrees Celsius [°C].Return Values  This function returns TRUE (1) if successful, otherwise FALSE (0).  Stg_HeatStageSetTemperatureRate Description&nbsp;{% raw %} Stg_HeatStageSetTemperatureRate(\n   double  TemperatureRate\n);{% endraw %}This function sets the heat stage heating/cooling temperature rate in °C/min.Parameters double  {% raw %}TemperatureRate{% endraw %} Heating/cooling rate in °C/min.Return Values  This function returns TRUE (1) if successful, otherwise FALSE (0).  Stg_HeatStageStartHeatingCooling Description&nbsp;{% raw %} Stg_HeatStageStartHeatingCooling();{% endraw %}When called the heating stage starts heating/cooling according to the target temperature that is set currently.  Stg_HeatStageStopHeatingCooling Description&nbsp;{% raw %} Stg_HeatStageStopHeatingCooling();{% endraw %}When called the heating/cooling device stops heating/cooling.  Stg_HeatStage_ContinueCooling Description&nbsp;{% raw %} Stg_HeatStage_ContinueCooling(\n   char *HeatStageName\n);{% endraw %}When called, the specified heating/cooling device starts cooling.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.  Stg_HeatStage_ContinueHeating Description&nbsp;{% raw %} Stg_HeatStage_ContinueHeating(\n   char *HeatStageName\n);{% endraw %}When called, the specified heating stage starts heating.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.  Stg_HeatStage_GetCount Description&nbsp;{% raw %} Stg_HeatStage_GetCount();{% endraw %}This function returns number of heating/cooling devices installed in the Device Manager.  Stg_HeatStage_GetCurrentTemperature Description&nbsp;{% raw %} Stg_HeatStage_GetCurrentTemperature(\n   char *HeatStageName\n);{% endraw %}Returns the current temperature of the heat stage.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.  Stg_HeatStage_GetName Description&nbsp;{% raw %} Stg_HeatStage_GetName(\n   int  HeatStageIndex,\n   char *HeatStageName\n);{% endraw %}This function retrieves the user name of a heating/cooling device.Parameters int  {% raw %}HeatStageIndex{% endraw %} Index number of the device. 0If a single device of this type is installed. char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.See Also&nbsp;   Stg_HeatStage_GetStatus Description&nbsp;{% raw %}int Stg_HeatStage_GetStatus(\n   char *HeatStageName\n);{% endraw %}This function returns information about the heating stage status.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.Return Values int Heating stage (temperature) status 0None - the status is not defined 1Cooling - the stage temperature is subsiding 2Heating - the stage temperature is rising to the defined limit 3Holding - the current temperature is being maintained on user request 4At Limit - the defined temperature has been reached and is maintained Different incubators/heating stages start “Holding” after the target temperature is reached and the function returns 3. Other devices reach the target temperature and let it uncontrolled afterwards - the function returns 4.  Stg_HeatStage_HoldCurrentTemperature Description&nbsp;{% raw %} Stg_HeatStage_HoldCurrentTemperature(\n   char *HeatStageName\n);{% endraw %}When called, the heating/cooling device will hold the current temperature.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.  Stg_HeatStage_SetTemperature Description&nbsp;{% raw %} Stg_HeatStage_SetTemperature(\n   char *HeatStageName,\n   double  Temperature\n);{% endraw %}Sets the target temperature of the specified heating/cooling device in degrees Celsius.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager. double  {% raw %}Temperature{% endraw %} The temperature in degrees Celsius [°C].  Stg_HeatStage_SetTemperatureRate Description&nbsp;{% raw %} Stg_HeatStage_SetTemperatureRate(\n   char *HeatStageName,\n   double  TemperatureRate\n);{% endraw %}This function sets the heat stage heating/cooling temperature range in °C/min.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager. double  {% raw %}TemperatureRate{% endraw %} Heating/cooling rate in °C/min.Return Values  This function returns TRUE (1) if successful, otherwise FALSE (0).  Stg_HeatStage_StartHeatingCooling Description&nbsp;{% raw %} Stg_HeatStage_StartHeatingCooling(\n   char *HeatStageName\n);{% endraw %}When called the heating/cooling device starts heating/cooling according to the target temperature that is set currently.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager.  Stg_HeatStage_StopHeatingCooling Description&nbsp;{% raw %} Stg_HeatStage_StopHeatingCooling(\n   char *HeatStageName\n);{% endraw %}When called the specified heating/cooling device stops heating/cooling.Parameters char *{% raw %}HeatStageName{% endraw %} Identification name of the device as it is displayed within the Device Manager. ",
