     content: "  ,  ,  ,  ,    Stg_GetNDFilterPosition Description&nbsp;{% raw %} Stg_GetNDFilterPosition();{% endraw %}This function returns the current ND filter intensity (double).  Stg_GetNDFilterStepPosition Description&nbsp;{% raw %} Stg_GetNDFilterStepPosition(\n   int  NDFilterPositionStep\n);{% endraw %}This function returns the actual ND filter intensity of the actual step.Parameters int  {% raw %}NDFilterPositionStep{% endraw %} The number of the step for which the filter intensity will be traced.  Stg_GetNDFilterSteps Description&nbsp;{% raw %} Stg_GetNDFilterSteps();{% endraw %}Returns a number of available ND filter steps.  Stg_IsNDFilterPresent Description&nbsp;{% raw %} Stg_IsNDFilterPresent();{% endraw %}This function determines whether the ND Filter logical device is present in the system. Returns TRUE or FALSE.  Stg_SetNDFilterPosition Description&nbsp;{% raw %} Stg_SetNDFilterPosition(\n   double  NDFilterPosition\n);{% endraw %}This function changes the intensity of the current ND filter.Parameters double  {% raw %}NDFilterPosition{% endraw %} The desired intensity value. The value must be available within the range of ND filter values. ",
