     content: "  ,  ,    Stg_CorrectionCollar_GetDescription Description&nbsp;{% raw %} Stg_CorrectionCollar_GetDescription(\n   double *CorrectionCollarRangeMin,\n   double *CorrectionCollarRangeMax\n);{% endraw %}Returns the minimum and maximum value defining the range of the correction collar.Parameters double *{% raw %}CorrectionCollarRangeMin{% endraw %} Minimum value of the correction collar. double *{% raw %}CorrectionCollarRangeMax{% endraw %} Maximum value of the correction collar.  Stg_CorrectionCollar_GetPosition Description&nbsp;{% raw %} Stg_CorrectionCollar_GetPosition(\n   double *LpCorrectionCollarPosition\n);{% endraw %}Returns the current position of the correction collar.Parameters double *{% raw %}LpCorrectionCollarPosition{% endraw %} Position of the correction collar.  Stg_CorrectionCollar_SetPosition Description&nbsp;{% raw %} Stg_CorrectionCollar_SetPosition(\n   double  CorrectionCollarPosition\n);{% endraw %}Sets the position of the correction collar.Parameters double  {% raw %}CorrectionCollarPosition{% endraw %} Position of the correction collar. ",
